import React from 'react';

const Footer=()=>{
    return(
        <>
        <footer className="footer">
            <div>
            <p>
                2020 Smartcare.
                all rights reserved | Terms and conditions applied.
            </p>
            </div>
        </footer>
        </>
    )
}
export default Footer;
